import React from "react";

const movies = [
  { title: "Movie 1", description: "Movie 1 description" },
  { title: "Movie 1", description: "Movie 1 description" },
  { title: "Movie 1", description: "Movie 1 description" },
  { title: "Movie 1", description: "Movie 1 description" },
  { title: "Movie 1", description: "Movie 1 description" },
];

export const MoviesList = () => {
  return (
    <div>
      MoviesList
      {movies.map((movie, index) => (
        <div key={index}>
          <h3>{movie.title}</h3>
          <p>{movie.description}</p>
        </div>
      ))}
    </div>
  );
};
